import React from "react";
import Header from "./components/Header";
import Intro from "./components/Intro";
import Card from "./components/Card";
import Footer from "./components/Footer";


class App extends React.Component {

  constructor(props) {
    super(props)
    this.state = {
      items: [
        {
          id: 1,
          img: '.webp',
          title: 'GUNSBET CASINO',
          subtitle: 'Welcome Bonus',
          description: '100% UP TO 1000 AUD + 100 FREE SPINS',
          link: '#',
          category: 'fruits',
          rate: 5
        },
        {
          id: 2,
          img: '.webp',
          title: 'Napoleon CASINO',
          subtitle: 'Welcome Bonus',
          description: '100% UP TO 1000 AUD + 100 FREE SPINS',
          link: '#',
          category: 'historical',
          rate: 4
        }
      ]
    }
  }

  render() {
    return (
      <div className='wrapper'>

        <Header/>
        <Intro/>

        <section className='productCards' id='productCards'>
          <div className='container'>
            <div className='productCards-inner'>
            <Card items={this.state.items}/>
            </div>
          </div>
        </section>

        <Footer/>

      </div>
    );
  }
}

export default App;
